import NavDropdown from 'react-bootstrap/NavDropdown';
function NavBar() {
  return (
    <div class="header">
      <h1>Vivacity Web Agency</h1>
      <p>Creatività e Innovazione per il tuo Business</p>
    </div>
    
  );
}
export default NavBar;
